&lt;p&gt;
Et voilà c&apos;est &quot;enfance vermifugée&quot;, une petite sélection pro avortement; une apologie de la dépression post partum; une introspection avec les propres musique de mon enfance (Ida Brun, qui est en fait ma grande tante) ou Boby Lapointe dont je ne supportais pas la voix. Pour petits et grands lardons; darone s et darons, ou les accros de la psychanalyse qui maudissent le complexe d&apos;Oedipe. Mort à l&apos;éducation nationale et vive la récréation.
&lt;/p&gt;

